from collections import deque


def find_new_neighbors(coordinate):
    '''
    :param coordinate: tupple = (int, int)
    :return: None
    :side effects: modify stop, is_finded, added_cells, queue, parents and orders_location_set
    Находим четырех соседей клетки и добавляем в очередь для поиска их соседей,
    прекращаем поиск, когда находим один из пунктов доставки
    '''

    global stop, is_found

    for j, k in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
        x, y = coordinate[0] + j, coordinate[1] + k
        if (0 <= x < size and 0 <= y < size and
                (x, y) not in added_cells and
                city_map_list[x][y] == 1):
            added_cells.add((x, y))
            queue.append((x, y))
            parents[(x, y)] = coordinate
            if (x, y) in orders_location_set:
                stop = (x, y)
                orders_location_set.remove((x, y))
                is_found = True
                break


def write_path(end, start):
    '''
    :param end: tupple = (int, int)
    :param start: tupple = (int, int)
    :return: None
    :side effects: modify variable - path
    Бежим по словарю соседей и строим путь между указанными точками
    '''
    x, y = end
    next_cell = parents.get((x, y))
    while next_cell != start:
        path.append(next_cell)
        next_cell = parents.get(next_cell)


