from copy import deepcopy
orders_location_1 = deepcopy(orders_location)

x = courier_location[0]
y = courier_location[1]
route = []
while orders_location:
    if x < orders_location[0][0] and city_map_list[y][x + 1] == 1:
        route.append((x + 1, y))
        x+=1
    elif x > orders_location[0][0] and city_map_list[y][x - 1] == 1:
        route.append((x - 1, y))
        x-=1
    elif y < orders_location[0][1] and city_map_list[y + 1][x] == 1:
        route.append((x, y + 1))
        y+=1
    elif y > orders_location[0][1] and city_map_list[y - 1][x] == 1:
        route.append((x, y - 1))
        y-=1
    else:
        del(orders_location[0])

print('Ответ:', route)
print('Время: ', 10 * len(route))


# Напечатаем карту
for j, i in route:
    city_map_list[i][j] = '*'

